import React from 'react'

export default class People extends React.Component {

    render() {
        const people = this.props.people

        return (
            <div>
                <h3>Waiting List</h3>
                <ul>Next up: {people.map((person, i) => (
                    <li key={i}>{person}</li>
                ))}</ul>
            </div>
        )
    }
}
